    //   </Container>
    // </ThemeProvider>




<Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
        <Grid >
            <Paper elevation={10} style={paperStyle} >

                {/ */}

                <Grid container spacing={1}>
                <Grid item xs={12} sm={6}>
                <TextField 
                    style={textfield} 
                    autoComplete="given-name"
                    name="firstName"
                    required
                    fullWidth
                    value={firstName}
                    onChange= {(e) => setFirstName(e.target.value)}
                    id="firstName"
                    label="First Name"
                    autoFocus
                  >

                </TextField>  
                </Grid>

                <Grid item xs={12} sm={6}>
                <TextField 
                    style={textfield} 
                    required
                    fullWidth
                    id="lastName"
                    value={lastName}
                    onChange= {(e) => setLastName(e.target.value)}
                    label="Last Name"
                    name="lastName"
                    autoComplete="family-name"
                  >
                </TextField>  
                </Grid>

                <Grid item xs={12}>
                <TextField 
                    style={textfield} 
                    required
                    fullWidth
                    id="email"
                    value={email}
                    onChange= {(e) => setEmail(e.target.value)}
                    label="Email Address"
                    name="email"
                    autoComplete="email"
                >
                </TextField>  
                </Grid>

                <Grid item xs={12}>
                <TextField 
                    style={textfield} 
                    required
                    fullWidth
                    id="street"
                    value={street}
                    onChange= {(e) => setStreet(e.target.value)}
                    label="Street"
                    name="street"
                    autoComplete="street"
                >
                </TextField>
                </Grid>

                <Grid item xs={12}>
                <TextField
                    style={textfield} 
                    required
                    fullWidth
                    id="city"
                    value={city}
                    onChange= {(e) => setCity(e.target.value)}
                    label="City"
                    name="city"
                    autoComplete="city"
                />
              </Grid>

              <Grid item xs={12}>
                <TextField
                    style={textfield} 
                    required
                    fullWidth
                    id="state"
                    value={state}
                    onChange= {(e) => setState(e.target.value)}
                    label="State"
                    name="state"
                    autoComplete="state"
                />
              </Grid>

              <Grid item xs={12} sm={6}>
              <TextField
                    style={textfield} 
                    required
                    fullWidth
                    id="zip"
                    value={zip}
                    onChange= {(e) => setZip(e.target.value)}
                    label="Zip"
                    name="zip"
                    autoComplete="zip"
                />
                </Grid>
                </Grid>

                <Grid container spacing={1}>
                <Grid item xs={12} sm={6}>
              <TextField
                    style={textfield} 
                    required
                    fullWidth
                    id="sneakerType"
                    value={sneakerType}
                    onChange= {(e) => setSneakerType(e.target.value)}
                    label="Sneaker"
                    name="sneakerType"
                    autoComplete="sneakerType"
                />
                </Grid>

                <Grid item xs={12} sm={6}>
                <TextField    
                    style={textfield}            
                    required
                    fullWidth
                    id="sneakerSize"
                    value={sneakerSize}
                    onChange= {(e) => setSneakerSize(e.target.value)}
                    label="Size"
                    name="sneakerSize"
                    autoComplete="sneakerSize"
                />
                </Grid>
                </Grid>

              <Divider style={divide}/>

              <SignInMenu />


              <Divider style={divide}/>

                <Stack justifyContent='center'>
                <Button
                    type="submit" 
                    color="primary" 
                    variant="contained" 
                    style={btnstyle}
                    size='medium'

                > 
                    Submit Request
                </Button>
                </Stack>

            </Paper>
            <Copyright sx={{ mt: 5 }}/>

        </Grid>
        </Box>


  );
}
